import{_ as e,c as t,o as a,a2 as i}from"./chunks/framework.8Hwwtx2f.js";const n="/Flu_H5_American-Wigeon_South-Carolina_2021-H5N1_DMS/assets/all_phenotypes.BVoccDAJ.png",_=JSON.parse('{"title":"","description":"","frontmatter":{"layout":"home","hero":{"name":"Deep mutational scanning of H5 influenza HA","tagline":"Experimental measurements of how mutations to HA of clade 2.3.4.4b strain A/American Wigeon/South Carolina/USDA-000345-001/2021 (H5N1) affect molecular phenotypes relevant to pandemic risk.","image":"images/schematic.png"},"features":[{"title":"summary","details":"Summary of how mutations affect all measured phenotypes","link":"/summary"},{"title":"cell entry","details":"Effects of mutations on pseudovirus entry in 293T cells","link":"/cell_entry"},{"title":"stability","details":"Effects of mutations on HA stability","link":"/stability"},{"title":"a2,6 sialic acid usage","details":"Effects of mutations on a2,6 sialic acid usage","link":"/a26_usage"},{"title":"NeuGc-containing glycan usage","details":"Effects of mutations on NeuGc glycan usage","link":"/NeuGc_usage"},{"title":"serum antibody escape","details":"Effects of mutations on neutralization by polyclonal sera","link":"/escape"},{"title":"experiments and biosafety","details":"Explanation of pseudovirus deep mutational scanning","link":"/experiments_and_biosafety"},{"title":"computational pipeline","details":"Details on the computational pipeline","link":"/pipeline_information"},{"title":"HA sequence numbering","details":"Explanation of sequence numbering schemes","link":"/numbering"},{"title":"Identifying HA mutations","details":"Using Nextclade to identify new HA mutations","link":"/identifying_ha_mutations"}]},"headers":[],"relativePath":"index.md","filePath":"index.md"}'),o={name:"index.md"},s=i('<h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>This website contains results from <a href="https://doi.org/10.1016/j.cell.2023.02.001" target="_blank" rel="noreferrer">pseudovirus deep mutational scanning</a> experiments that measure the effects of mutations to the hemagglutinin (HA) of the 2.3.4.4b clade strain A/American Wigeon/South Carolina/USDA-000345-001/2021 (H5N1) on several key molecular phenotypes.</p><p>The paper describing this study is <a href="https://doi.org/10.1371/journal.pbio.3002916" target="_blank" rel="noreferrer">Dadonaite et al (2024)</a>. However, note that this page may be updated from the version in that paper. To get the release exactly describing to the paper as well as seeing any updates, look at the <a href="https://github.com/dms-vep/Flu_H5_American-Wigeon_South-Carolina_2021-H5N1_DMS/blob/main/CHANGELOG.md" target="_blank" rel="noreferrer">CHANGELOG</a>.</p><p>The links in the boxes above take you to interactive plots or descriptions of different aspects of the study. For a high-level overview, see the <a href="./summary.html" target="_self">summary</a> of how mutations affect all phenotypes, or examine the data in a structural context using <a href="https://dms-viz.github.io/v0/?data=https%3A%2F%2Fraw.githubusercontent.com%2Fdms-vep%2FFlu_H5_American-Wigeon_South-Carolina_2021-H5N1_DMS%2Fmain%2Fresults%2Fdms-viz%2Fdms-viz.json" target="_blank" rel="noreferrer">this dms-viz link</a>. To delve into the data in more detail, click on the boxes above for each individual phenotype.</p><p>You can also examine the output of the full <a href="./pipeline_information.html" target="_self">computational pipeline</a> and look at the underlying code <a href="https://github.com/dms-vep/Flu_H5_American-Wigeon_South-Carolina_2021-H5N1_DMS" target="_blank" rel="noreferrer">on GitHub</a>. <a href="https://github.com/dms-vep/Flu_H5_American-Wigeon_South-Carolina_2021-H5N1_DMS/blob/main/results/summaries/phenotypes.csv" target="_blank" rel="noreferrer">Here is a CSV file</a> of the numerical values of the measurements with pre-filtering for high-confidence values.</p><h2 id="ha-phenotypes-measured-in-this-study" tabindex="-1">HA phenotypes measured in this study <a class="header-anchor" href="#ha-phenotypes-measured-in-this-study" aria-label="Permalink to &quot;HA phenotypes measured in this study&quot;">​</a></h2><p>This study measures how mutations affect four HA phenotypes:</p><ul><li><em>HA-mediated entry into 293T cells</em>: positive values indicate better entry than the parental HA, negative values indicate impaired entry.</li><li><em>HA stability</em>: positive values indicate greater stability (tolerance to more acidic conditions) than the parental HA.</li><li><em>a2,6 sialic acid usage</em>: positive values indicate improved usage of a2,6 sialic acids.</li><li><em>Escape from serum antibody neutralization</em>: positive values indicate reduced neutralization by serum, negative values indicate more neutralization.</li></ul><p><img src="'+n+'" alt="schematic of phenotypes measured"></p>',9),r=[s];function l(u,m,c,p,h,d){return a(),t("div",null,r)}const g=e(o,[["render",l]]);export{_ as __pageData,g as default};
